CREATE TABLE Company(
	coName varchar(255) NOT NULL PRIMARY KEY
);


CREATE TABLE Airplane(
	aName varchar(255) NOT NULL PRIMARY KEY,
	seats int
);


CREATE TABLE Owner(
	coName varchar(255), 
	aName varchar(255),
	CONSTRAINT coOwner FOREIGN KEY (coName) REFERENCES Company(coName),
	CONSTRAINT aOwner FOREIGN KEY (aName) REFERENCES Airplane(aName)
);


CREATE TABLE City(
	ciName varchar(255) NOT NULL PRIMARY KEY
);


CREATE TABLE Travel(
	tID int NOT NULL PRIMARY KEY,
    up timestamp ,
	down timestamp ,
	priece int NOT NULL,
	aName varchar(255),
    CONSTRAINT aTravel FOREIGN KEY(aName) REFERENCES Airplane(aName),
	now varchar(255),
    CONSTRAINT nTravel FOREIGN KEY(now) REFERENCES City(ciName),
	dest varchar(255),
    CONSTRAINT dTravel FOREIGN KEY(dest) REFERENCES City(ciName)
	
    
);


CREATE TABLE Rate(
	tID int,
    CONSTRAINT tRate FOREIGN KEY(tID) REFERENCES Travel(tID),
	sold int
);






